import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { AuthService } from '../_services/auth.service';
import { Router } from '@angular/router';
import { HttpErrorResponse } from '@angular/common/http';
import { User } from '../_models/user';

@Component({
  selector: 'app-welcome',
  templateUrl: './welcome.component.html',
  styleUrls: ['./welcome.component.css']
})
export class WelcomeComponent {

LgForm!: FormGroup;
submitted = false;
loading = false;
isLoginError : boolean = false;
UserName: any;
Password: any;
user= new User();

constructor( private fg : FormBuilder, private auth : AuthService, private router: Router){}

ngOnInit(): void{
  this.LgForm = this.fg.group({

    UserName: ['', Validators.required],
    Password: ['', Validators.required],

  });

}

get f() { return this.LgForm.controls; }

  onLogin(UserName: any, Password: any) {
    this.submitted = true;
    if (this.LgForm.invalid) {
      return;
    }

    this.loading = true;


    this.auth.login(this.LgForm.value).subscribe((token : string) => {
      localStorage.setItem('authToken', token);
      alert("Successfully Logged In");
      this.router.navigate(['/list']);
    },
      err=>{
        alert("Wrong UserName or Password");
      });

  }





}
<section class="vh-100" style="background-color: #9A616D;">
    <div class="container py-5 h-100">
      <div class="row d-flex justify-content-center align-items-center h-100">
        <div class="col col-xl-10">
          <div class="card" style="border-radius: 1rem;">
            <div class="row g-0">
              <!-- <div class="col-md-6 col-lg-5 d-none d-md-block">
                <img src="https://mdbcdn.b-cdn.n/img/Phots/new-templats/bootstrap-login-fm/im1.wep"
                  alt="login form" class="img-fluid" style="border-radius: 1rem 0 0 1rem;" />
              </div> -->
              <div class="col-md-6 col-lg-7 d-flex align-items-center">
                <div class="card-body p-4 p-lg-5 text-black">

                  <form [formGroup]="LgForm"  (ngSubmit)="onLogin(UserName, Password)" >

                    <div class="d-flex align-items-center mb-3 pb-1">
                      <i class="fas fa-cubes fa-2x me-3" style="color: #ff6219;"></i>
                      <span class="h1 fw-bold mb-0">Logo</span>
                    </div>

                    <h5 class="fw-normal mb-3 pb-3" style="letter-spacing: 1px;">Sign into your account</h5>

                    <div class="form-outline mb-4">
                      <input type="username"  formControlName= "UserName" name="UserName" class="form-control form-control-lg"
                      [ngClass]="{ 'is-invalid': submitted && f['UserName'].errors }"  />
                      <div *ngIf="submitted && f['UserName'].errors" class="invalid-feedback">
                        <div *ngIf="f['UserName'].errors">UserName is required</div>
                    </div>
                      <label class="form-label" >Username</label>

                    </div>

                    <div class="form-outline mb-4">
                      <input type="password" formControlName= "Password" name="Password" class="form-control form-control-lg"
                      [ngClass]="{ 'is-invalid': submitted && f['Password'].errors }"   />
                      <div *ngIf="submitted && f['Password'].errors" class="invalid-feedback">
                        <div *ngIf="f['Password'].errors">Password is required</div>
                    </div>
                      <label class="form-label" for="form2Example27">Password</label>
                    </div>

                    <div class="pt-1 mb-4">
                      <button type="button" [disabled]="loading"  class="btn btn-dark btn-lg btn-block" >Login</button>
                    </div>


                    <p class="mb-5 pb-lg-2" style="color: #393f81;">Don't have an account? <a routerLink="/reguser"
                        style="color: #393f81;">Register here</a></p>
                    <a href="#!" class="small text-muted">Terms of use.</a>
                    <a href="#!" class="small text-muted">Privacy policy</a>
                  </form>

                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </section>
